import me from '../src/me.svg'
import Box from '@material-ui/core/Box';

function Hero() {
  return (
    <Container style={{ background: '#F2E7D6', position: 'absolute', padding: '10px', mr: '10px', height:'800px'}}  maxWidth="xl">
        <Grid container spacing = {10} alignContent="flex-start"  alignItems="center" justifyContent="center"> 
        {/* <h1>Hi</h1> */}
