          </Box>
          <Grid item>
          <Box bgcolor="secondary.light" p={0}>
            <p style={{fontFamily: 'josefin sans', fontSize: 25}}>Thereâ€™s a smarter way to do business. A way that includes next-level services, a determined, relentless, and passionate consultant, and a unique perspective to help startups, founders, and visionaries get to the next level. </p>
          </Box>
        </Grid>
        <Grid item>
         <Button style={{fontFamily: 'montserrat', color: "white", backgroundColor: "#154D43", borderRadius: 10}}>Schedule a Meeting</Button>
